import React from "react";
import "./TarotReadings.css";
import Thumbnail from "../components/Thumbnail";
import "../components/NewItems.css";

function TarotReadings() {
  return (
    <>
      <div class="container">
        <h1 class="reading-title">PURCHASE A READING</h1>
        <h2 id="h2">Same Day Readings</h2>
        <div class="thumbnail-container">
          <Thumbnail backgroundImage="/images/stickers.png" />
          <Thumbnail backgroundImage="/images/stickers.png" />
          <Thumbnail backgroundImage="/images/stickers.png" />
          <Thumbnail backgroundImage="/images/stickers.png" />
          <Thumbnail backgroundImage="/images/stickers.png" />
          <Thumbnail backgroundImage="/images/stickers.png" />
        </div>
        <h2 id="h2">Other Readings</h2>
        <div class="thumbnail-container">
          <Thumbnail backgroundImage="/images/stickers.png" />
          <Thumbnail backgroundImage="/images/stickers.png" />
          <Thumbnail backgroundImage="/images/stickers.png" />
          <Thumbnail backgroundImage="/images/stickers.png" />
          <Thumbnail backgroundImage="/images/stickers.png" />
          <Thumbnail backgroundImage="/images/stickers.png" />
        </div>
      </div>
    </>
  );
}

export default TarotReadings;
